import React from "react";
import "./Hamburger.scss";

function Hamburger() {
  const handleClick = (e) => {
    e.target.classList.toggle("nav-open");
  };

  return (
    <button
      className="hamburger hide-for-desktop"
      aria-expanded="false"
      onClick={handleClick(e)}
    >
      <span></span>
      <span></span>
      <span></span>
    </button>
  );
}

export default Hamburger;
